import {React, useEffect} from 'react';
import Button from "@mui/material/Button";
import Stack from "@mui/material/Stack";
import TextField from "@mui/material/TextField";
import Typography from "@mui/material/Typography";
import { useTheme } from "@mui/material/styles";
import { useNavigate } from 'react-router-dom';
import { newPassword } from '../../api/auth';

const NewPass = () => {
    const theme = useTheme();
    const {token} = useParams()
    const primaryColor = theme.palette.primary.main;
    const gray1 = theme.palette.gray1.main;
    const gray2 = theme.palette.gray2.main;
    const navigate = useNavigate();

    const buttonStyle = {
      width: "140px",
      borderRadius: "8px",
      color: primaryColor,
      textTransform: "none",
    };

    useEffect(()=> {
      newPassword()
      .then((res)=> {
          // setPaymet(res.data);
          console.log(res.data);
      })
      .catch((err) => {
          console.log(err);
      })
  }, []);


    return (
      <Stack
        spacing={5}
        sx={{
          width: "616px",
          margin: "0 auto",
          marginTop: "96px",
          textAlign: "left",
        }}
      >
        <Stack spacing="60px">
            <Typography variant="h5" component="h1" sx={{ color: gray1 }}>
              Create Password
            </Typography>
          <Stack spacing='24px'>
            <TextField type="password" label="New Password" />
            <TextField type="password" label="Confirm New Password" />
          </Stack>

        </Stack>
        <Stack direction="row" spacing={3} sx={{ alignSelf: "flex-end" }}>
          <Button 
          variant="outlined" color="primary" sx={buttonStyle}
          onClick={() => navigate('/login')}>
            Cancel
          </Button>
          <Button
          variant="contained" color="secondary" sx={buttonStyle}
          onClick={() => navigate('/login')}>
            Submit
          </Button>
        </Stack>
      </Stack>
    );
  };

export default NewPass;
